import React, { useState } from "react";
import "./App.css";
function App() {
  const [isLoggedIn, setIsLoggerIn] = useState(false);

  const hanndleLogin = () => {
    setIsLoggerIn(true);
  };

  const hanndleLogout = () => {
    setIsLoggerIn(false);
  };

  return (
    <div>
      <h1>Smileys</h1>
      <div className="loginControl">
        {isLoggedIn ? (
          <button onClick={hanndleLogout}>Logout</button>
        ) : (
          <button onClick={hanndleLogin}>Login</button>
        )}
      </div>
      {String(isLoggedIn)}
    </div>
  );
}
export default App;
